pub enum EvalexprError {
    WrongOperatorArgumentAmount {
            expected: usize,
            actual: usize,
        },
    WrongFunctionArgumentAmount {
            expected: usize,
            actual: usize,
        },
    ExpectedString {
            actual: Value,
        },
    ExpectedInt {
            actual: Value,
        },
    ExpectedFloat {
            actual: Value,
        },
    ExpectedNumber {
            actual: Value,
        },
    ExpectedNumberOrString {
            actual: Value,
        },
    ExpectedBoolean {
            actual: Value,
        },
    ExpectedTuple {
            actual: Value,
        },
    ExpectedFixedLenTuple {
            expected_len: usize,
            actual: Value,
        },
    ExpectedEmpty {
            actual: Value,
        },
    AppendedToLeafNode,
    PrecedenceViolation,
    VariableIdentifierNotFound(String),
    FunctionIdentifierNotFound(String),
    TypeError {
            expected: Vec<ValueType>,
            actual: Value,
        },
    WrongTypeCombination {
            operator: Operator,
            actual: Vec<ValueType>,
        },
    UnmatchedLBrace,
    UnmatchedRBrace,
    MissingOperatorOutsideOfBrace,
    UnmatchedPartialToken {
            first: PartialToken,
            second: Option<PartialToken>,
        },
    AdditionError {
            augend: Value,
            addend: Value,
        },
    SubtractionError {
            minuend: Value,
            subtrahend: Value,
        },
    NegationError {
            argument: Value,
        },
    MultiplicationError {
            multiplicand: Value,
            multiplier: Value,
        },
    DivisionError {
            dividend: Value,
            divisor: Value,
        },
    ModulationError {
            dividend: Value,
            divisor: Value,
        },
    InvalidRegex {
            regex: String,
            message: String,
        },
    ContextNotMutable,
    IllegalEscapeSequence(String),
    CustomMessage(String),
}
